/*Table structure for table `programacion` */

DROP TABLE IF EXISTS `programacion`;

CREATE TABLE `programacion` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_prog` date NOT NULL,
  `exercise_id` int(11) NOT NULL,
  `status` enum('Activo','Cumplido','Cancelado') DEFAULT 'Activo',
  `username` varchar(50) NOT NULL,
  `medical_center_id` int(11) NOT NULL,
  `medico_id` int(11) NOT NULL,
  `addsysfec` timestamp NOT NULL DEFAULT current_timestamp(),
  `addcoduser` varchar(20) DEFAULT NULL,
  `modsysfec` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `modcoduser` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `programacion_ibfk_1_idx` (`username`),
  KEY `programacion_ibfk_2_idx` (`medico_id`),
  KEY `programacion_ibfk_3` (`exercise_id`),
  KEY `programacion_ibfk_4_idx` (`medical_center_id`),
  CONSTRAINT `programacion_ibfk_1` FOREIGN KEY (`username`) REFERENCES `user` (`username`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `programacion_ibfk_2` FOREIGN KEY (`medico_id`) REFERENCES `medico` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `programacion_ibfk_3` FOREIGN KEY (`exercise_id`) REFERENCES `exercise` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `programacion_ibfk_4` FOREIGN KEY (`medical_center_id`) REFERENCES `medical_center` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

