/* Function  structure for function  `fn_subtract_date` */

/*!50003 DROP FUNCTION IF EXISTS `fn_subtract_date` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `fn_subtract_date`(`inicial` DATE, `final` DATE) RETURNS int(11)
BEGIN
	declare resultado int;
	declare value_year int;
    declare value_month int;
    declare value_day int;
    declare tmp_date int;
    
    if inicial < final then
		set tmp_date = inicial;
        set inicial = final;
        set final = tmp_date;
    end if;
    
    /* Select the number of years */
    set value_year = TIMESTAMPDIFF(YEAR,final,inicial)*10000;
    /** Select the number of months by adding the number of years to the 'final' date field */
    set value_month = TIMESTAMPDIFF(MONTH,DATE_ADD(final,INTERVAL TIMESTAMPDIFF(YEAR,final,inicial) YEAR), inicial)*100;
    /* Select the number of days by adding the number of years and number of months to the 'final' field */
    set value_day = TIMESTAMPDIFF(DAY,DATE_ADD(DATE_ADD(final,INTERVAL TIMESTAMPDIFF(YEAR,final,inicial) YEAR),
		INTERVAL TIMESTAMPDIFF(MONTH,DATE_ADD(final,INTERVAL TIMESTAMPDIFF(YEAR,final,inicial) YEAR), inicial) MONTH),inicial);

	set resultado = value_year+value_month+value_day;

RETURN resultado;
END */$$
DELIMITER ;

